```solidity
pragma solidity ^0.8.0;

contract Contract {
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;

    uint256 public totalSupply;
    string public name;
    uint8 public decimals;
    string public symbol;
    string public version;
    uint256 public unitsOneEthCanBuy;
    uint256 public totalEthInWei;
    address payable public fundsWallet;

    constructor() payable {
        if (msg.value == 0) {
            balanceOf[msg.sender] = 0xac0db698068112d000000;
            totalSupply = 0xac0db698068112d000000;
            name = "";
            decimals = 18;
            symbol = "";
            unitsOneEthCanBuy = 700;
            fundsWallet = payable(msg.sender);
        }
        version = "0";
    }

    fallback() external payable {
        totalEthInWei = totalEthInWei + msg.value;
        require(balanceOf[fundsWallet] >= msg.value * unitsOneEthCanBuy);
        balanceOf[fundsWallet] = balanceOf[fundsWallet] - msg.value * unitsOneEthCanBuy;
        balanceOf[msg.sender] = balanceOf[msg.sender] + msg.value * unitsOneEthCanBuy;

        fundsWallet.transfer(msg.value);
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[_from] >= _value && _value > 0 && allowance[_from][msg.sender] >= _value);
        balanceOf[_to] += _value;
        balanceOf[_from] -= _value; 
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value && _value > 0);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        (bool success,) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,address,bytes)", msg.sender, _value, this, _extraData));
        return success;
    }
}
```
